    <div className="videoFooter">
        <div className="videoFooter__text">
            <h3>@Med5</h3>
            <p>Just love coding with big screen</p>
            <div className="videoFooter__ticker" >
                <MusicNoteIcon  className="videoFooter__icon" />
            </div>
        </div>
    </div>
  )
}

export default VideoFooter;
